LINQ, Language Integrated Query, is a object oriented and strongly typed native syntax used to express queries in C# and VB.NET Any type that implements IEnumerable can be used as an input to a LINQ statement. This is also includes: Results from other LINQ statements Standard collections (List, Array, etc..) Specialised LINQ providers: LINQ to SQL LINQ to XML LINQ to ADO.NET using System.Linq; class Person { public string name {get; set}; public int age {get; set};
} void main() { // 1. Obtain the data source IEnumerable<Person> people = new Person[] { new Person { "Paul", 23 }, new Person { "Jill", 18 }, }; // 2. Create the query IEnumerable<string> query = from p in people where p.age > 21 select p.name.ToUpper(); // 3. Execute the query foreach (string name in query) { Console.WriteLine(name); }
} {{#quiz ../../quizzes/6-3.toml}}

